DROP TABLE IF EXISTS `taskqueue`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `taskqueue` (
  `id` int(5) NOT NULL AUTO_INCREMENT COMMENT 'auto increase',
  `keywords` varchar(50) NOT NULL COMMENT '查询关键字',
  `table_name` varchar(30) NOT NULL COMMENT '对应关键字的表名,表名结构：pretablename_begintime_endtime',
  `begintime` timestamp NOT NULL DEFAULT '2006-01-01 00:00:00' COMMENT '查询的开始时间',
  `endtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '查询的结束时间',
  `now` timestamp NOT NULL DEFAULT '1980-01-01 00:00:00' COMMENT '爬虫当前爬到了什么地方',
  `status` int(3) NOT NULL DEFAULT '-1' COMMENT '本条任务状态：-1-未爬，0-已爬，但是now没有爬到endtime，1-已爬完，即now等于endtime，2-其他爬虫正在使用',
  PRIMARY KEY (`id`),
  KEY `taskqueue_status_index` (`status`) COMMENT '对任务状态做索引，方便查找'
) ENGINE=InnoDB AUTO_INCREMENT=12287 DEFAULT CHARSET=utf8mb4;
